<H1><A NAME="c4026"></A><SUP></SUP>Compiler Warning (level 1) C4026</H1>

<P class=dt><B>function declared with formal parameter list</B></P>

<P>The function was declared to take formal parameters, but the function definition did not have formal parameters.</P>

<P>Subsequent calls to this function will assume that the function takes no actual parameters.</P>
